INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(1, 'Jabolčna pita', 'Med vsemi jabolčnimi sladicami, s katerimi so nas razvajale naše babice, si prav posebno mesto zasluži jabolčna pita iz pekača. Sladica je hkrati krhka in sočna in se kar stopi v ustih, najboljša pa je s skodelico toplega napitka. Obudite spomin na otroštvo in si priljubljeno jabolčno pito pripravite še danes!', 393, '8', '45 min', , 3);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(2, 'Pečen piščanec in krompir v paradižnikovi omaki', 'Sočna in okusna jed, ki bo navdušila prav vse družinske člane. Primerna je za vse dni v tednu, za dodatno dozo vitaminov pa zraven postrezite še veliko skledo sezonske zelenjave.', 481, '4', '1 ura', , 2);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(3, 'Kuskus z bučkami in piščancem', 'Hitro pripravljen obrok, ki vas bo vsaj dvakrat navdušil. Prvič z enostavno pripravo, drugič pa z odličnim okusom. Poleg bučk lahko dodate tudi papriko, sušene paradižnike, grah in jajčevce, jed pa za piko na i popestrite s sesekljanim peteršiljem ali meto. ', 478, '4', '25 min', , 2);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(4, 'Čemaževa kremna juha', 'Pravijo, da lahko s čemažem učinkovito prečistimo telo in ga spodbudimo k boljšemu delovanju. Najbolje je, da to preizkusite kar na lastni koži in za začetek poskusite odlično čemaževo kremno juho, ki bo vaše telo med drugim tudi napolnila z energijo.', 212, '4', '37 min', , 1);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(5, 'Ribja juha', 'Okusna juha, pripravljena iz ribjih ostankov, ribjega fileja in zelenjave. Na izločitvenem testu, ki je potekal v 14. oddaji 7. sezone MasterChef Slovenija jo je pripravila Maša Trubačev in si z njo prislužila balkon.', 175, '2', '30 min', , 1);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(6, 'Prebranec s slanino', 'Prebranec se največkrat uporablja kot priloga jedem z žara, lahko pa ga postrežemo tudi kot samostojno jed. Priprava domačega prebranca je zelo enostavna, ni pa tudi najbolj hitra, saj moramo fižol najprej nekaj ur namakati, nato ga kuhamo, na koncu pa se jed peče še v pečici, da se na vrhu naredi lepa zapečena skorjica. V brezmesni različici lahko tudi izpustite dodatek slanine.', 527, '4', '2h 20min', , 1);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(7, 'Bučna juha', 'Sveža in moderna različica ene najbolj priljubljenih jesenskih jedi - bučne juhe.', 327, '2', '30 min', , 1);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(8, 'Piščančji file v smetanovi omaki s špinačo in suhi', 'Okusna kombinacija nežnega piščančjega mesa v slastni smetanovi omaki, obogateni s špinačo in suhimi paradižniki. Jed vas bo navdušila v več pogledih, saj poleg tega, da je pripravljena zgolj v eni ponvi in dobre pol ure, je tudi tako dobra, da boste krožnike z veseljem pomazali do zadnje kapljice. Kar se tiče prilog, lahko zraven postrežete samo kos ali dva kruha in skledo solate.', 446, '4', '23 min', , 2);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(9, 'Hrustljav in sočen piščanec, mariniran v pinjencu', 'Super ideja, kako lahko piščanca povzdignete v praznično kosilo ali večerjo, ki si ju bodo vsi zapomnili. Ker boste piščanca pred peko vsaj 12 ur marinirali v pinjencu, se vam bo meso kar topilo v ustih.', 584, '6', '1h 10min', , 2);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(10, 'Lignji v paradižnikovi omaki', 'Lignji v paradižnikovi omaki so dobri topli ali hladni. Privoščite si jih zgolj s hrustljavim belim kruhom, ki ga boste z užitkom pomakali v okusno omako ali pa zraven postrezite kremno polento. Jed vas bo navdušila tudi s hitro in preprosto pripravo, zato smo prepričani, da se bo večkrat znašla na vašem jedilniku.', 454, '2', '50 min', , 2);
INSERT INTO `recept` (`id_recepta`, `ime_jedi`, `opis_jedi`, `kalorije`, `količina`, `cas_priprave`, `slika`, `idVrsta_jedi`) VALUES
(11, 'Hitre testenine iz ene ponve', 'Ekspresno pripravljene testenine, za katere potrebujete le nekaj sestavin in eno samo ponev. Če kokošje osnove nimate pri roki, jo lahko nadomestite z vodo.', 441, '3', '20 min', , 2);

