INSERT INTO `recept_priprava` (`id_recept_priprava`, `id_recepta`, `id_koraka`, `opis_jedi`) VALUES
(1, 1, 1, 'Najprej pripravimo testo. V skledo presejemo moko in pecilni prašek. Dodamo sol in sladkor ter sestavine dobro premešamo. Dodamo na koščke narezano maslo in maščobo s konicami prstov vgnetemo v suhe sestavine ter mešanico pri tem dvigamo, da postane zračna in podobna drobtinam. Dodamo rumenjake in kislo smetano ter na hitro zgnetemo testo, ki ga oblikujemo v kepo, zavijemo v folijo za živila in vsaj za 30 minut shranimo v hladilnik. '),
(2, 1, 2, 'Medtem ko testo počiva, pripravimo nadev. Jabolka olupimo in naribamo. Stresemo jih v primerno veliko kozico, ki jo pristavimo na kuhalnik. Jabolka po okusu sladkamo in začinimo z vanili sladkorjem, limoninim sokom in cimetom. Na nizki temperaturi jih med občasnim mešanjem dušimo toliko časa, da se zmehčajo, tekočina pa izhlapi. Odstavimo in ohladimo. '),
(3, 1, 3, 'Pečico segrejemo na 180 stopinj Celzija. Testo vzamemo iz hladilnika in ga razdelimo na dva dela. Manjši pravokoten pekač obložimo s papirjem za peko (lahko ga tudi namastimo z maslom in poprašimo z moko). Vzamemo en kos testa in ga na pomokani delovni površini razvaljamo v velikosti pekača. Testo previdno položimo v pekač in ga oblikujemo tako, da z njim v celoti prekrijemo dno. Na več mestih ga prebodemo z vilicami in enakomerno debelo obložimo z jabolčnim nadevom. Vzamemo drugi kos testa, ga razvaljamo v velikosti pekača in z njim v celoti prekrijemo jabolčni nadev. Pekač za 40 do 50 minut potisnemo v ogreto pečico, da se testo lepo zlato rjavo zapeče. '),
(4, 1, 4, 'Jabolčna pita je najokusnejša, ko je še topla. Pred serviranjem jo potrosimo s sladkorjem v prahu in narežemo na kose. '),
(5, 2, 1, 'Pečico segrejemo na 200 stopinj Celzija. Kose piščanca na obeh straneh začinimo s poprom in soljo. Začimbe z rokami dobro vtremo v meso. '),
(6, 2, 2, 'Večjo ponev dobro segrejemo in jo namastimo z olivnim oljem. Dodamo začinjene kose piščanca in jih na vsaki strani pečemo 3 minute oziroma toliko časa, da se ne površini naredi zlato rjava skorjica. '),
(7, 2, 3, 'Medtem ko se piščanec peče, krompir olupimo, očistimo in operemo. Narežemo ga na kose. Čebulo olupimo in jo grobo sesekljamo. '),
(8, 2, 4, 'Iz ponve odstranimo popečene kose piščanca in jih shranimo na toplem krožniku. V ponvi pustimo dve žlici maščobe, ostalo pa odlijemo. Dodamo čebulo in neolupljene česnove stroke ter vse skupaj na hitro popražimo. Primešamo paradižnikov koncentrat in omako ter prilijemo vodo. Po okusu začinimo s soljo in poprom ter s kuhalnico dobro postrgamo po dnu, da odlepimo vse karamelizirane koščke, nato pa v omako dodamo krompir in popečene kose piščanca. '),
(9, 2, 5, 'Počakamo, da omaka v ponvi zavre, nato pa vse skupaj pretresemo v pekač, ki ga za približno 50 minut potisnemo v ogreto pečico. Če imamo ponev z ognjevarnim ročajem, ne potrebujemo pekača, ampak vse skupaj do konca spečemo kar v ponvi. '),
(10, 2, 6, 'Jed je pečena, ko v pekaču povre skoraj vsa omaka, krompir se zmehča, piščanec pa je  pečen tudi v notranjosti. Po pripravljeni jedi potrosimo sesekljan peteršilj. '),
(11, 3, 1, 'Bučke operemo in osušimo. Po dolžini jih prerežemo na pol, nato pa jih še enkrat razpolovimo, da dobimo četrtine, ki jih narežemo na približno 0,5 cm široke rezine. Piščančje prsi narežemo na za grižljaj velike kose, česen pa olupimo in drobno sesekljamo. '),
(12, 3, 2, 'Jušno osnovo vlijemo v kozico in jo segrejemo do vretja. Kuskus stresemo v skledo. Prelijemo ga s toliko vroče jušne osnove, da je so vsa zrnca pokrita s tekočino. Skledo pokrijemo in pustimo, da kuskus vpije vso tekočino in se napne.'),
(13, 3, 3, 'V večjo ponev vlijemo olje in počakamo, da se segreje. Dodamo piščančje meso in ga med mešanjem iz vseh strani na hitro popražimo. Dodamo bučke, pražimo še 4-5 minut, potem pa primešamo sesekljan česen. Začinimo s soljo, poprom in limonino lupinico ter sestavine med nenehnim mešanjem pražimo še 2 minuti.'),
(14, 3, 4, 'Ko kuskus nabrekne, ga z vilicami razdrobimo, da razpade na posamezna zrna. Dodamo ga v ponev s popraženimi bučkami in piščancem. Po okusu začinimo z limoninim sokom, vse skupaj dobro premešamo in odstavimo. '),
(15, 3, 5, 'Pripravljen kuskus serviramo na krožnike. Potrosimo ga z naribanim sirom in postrežemo. '),
(16, 4, 1, 'Čebulo olupimo in drobno sesekljamo. Krompir olupimo, operemo in narežemo na manjše koščke. V loncu segrejemo dve žlici olja, na katerem postreklenimo sesekljano čebulo. Dodamo narezan krompir in ga skupaj s čebulo med nenehnim mešanjem pražimo 1 do 2 minuti. Prilijemo jušno osnove, lonec delno pokrijemo in kuhamo tako dolgo, da se krompir povsem zmehča.'),
(17, 4, 2, 'Medtem ko se krompir kuha, liste čemaža očistimo, operemo in grobo sesekljamo. Ko je krompir kuhan, jih dodamo v lonec in pustimo, da se kuhajo 5 minut.'),
(18, 4, 3, 'Lonec odstavimo in juho gladko zmiksamo s paličnim mešalnikom. Lonec nato ponovno pristavimo na kuhalnik in v juho vmešamo eno žlico olivnega olja. Po okusu jo začinimo s soljo in poprom, zavremo ter odstavimo. Juho serviramo v globoke krožnike ali jušne skodelice, okrasimo s kislo smetano in postrežemo.'),
(19, 5, 1, 'Najprej pripravimo ribjo osnovo. V lonec dodamo nekaj ribjih kosti in glave, olupke čebule in česna, stebelno zeleno, koromač in peteršilj. Zalijemo s hladno vodo, lonec  pokrijemo s pokrovko in ga pristavimo na kuhalnik. Ko voda zavre, iz lonca odstranimo ribje glave in pustimo, da se osnova kuha dalje. '),
(20, 5, 2, 'V drugem loncu segrejemo olje, na katerem na čebuli in česnu popečemo preostale ribje kosti in jih zalijemo z vinom. Malo pokuhamo, nato pa ribje kosti postopno zalivamo z jušno osnovo, ki smo jo pripravili. Primešamo paradižnikovo mezgo in vse skupaj še malo pokuhamo.'),
(21, 5, 3, 'Ribjo juho dobro precedimo in jo prelijemo v lonec. Pustimo, da se počasi kuha dalje. Po okusu jo solimo in popramo.'),
(22, 5, 4, 'V ponvi popečemo ribji file, ki mu odstranimo kožo in ga natrgamo na kose.'),
(23, 5, 5, 'Juho skupaj z natrganimi kosi fileja serviramo v globoke krožnike ter pripravljeno jed postrežemo. '),
(24, 6, 1, 'Namočen fižol odcedimo, stresemo v večji lonec in zalijemo s hladno vodo. Pristavimo na kuhalnik in počakamo, da voda zavre. '),
(25, 6, 2, 'Fižol ponovno odcedimo in ga zalijemo s toliko hladne vode, da je njen nivo vsaj tri prste nad fižolom.. Dodamo lovorjeva lista in fižol kuhamo 1 uro oziroma toliko časa, da se zrna zmehčajo. Fižol solimo, ko je že skoraj povsem kuhan. '),
(26, 6, 3, 'Čebulo olupimo in jo narežemo na rezine. V ponvi segrejemo olje in na njem pražimo narezano čebulo približno 15 minut, da se v celoti zmehča. Po potrebi prilijemo tudi malo vode. Popraženo čebulo posolimo in jo zmešamo z mleto papriko. '),
(27, 6, 4, 'Kuhan fižol odcedimo in pri tem prihranimo tekočino, v kateri se je kuhal. Zmešamo ga s popraženo čebulo in z na rezine ali kockice narezano slanino. Prilijemo še toliko prihranjene tekočine, da dobimo sočno zmes. '),
(28, 6, 5, 'Zmes pretresemo v namaščen ognjevaren pekač, ki ga za približno 60 minut potisnemo v pečico, ogreto na 180 stopinj Celzija. Pečen prebranec mora biti gost, na površini pa mora imeti zapečeno skorjico. Preden prebranec postrežemo, naj nekoliko počaka. '),
(29, 7, 1, 'Bučo olupimo. 100 g je narežemo na 1-2 cm velike kocke in prihranimo za kasneje. '),
(30, 7, 2, 'Preostalo bučo drobno nasekljamo in na srednjem ognju pokrito kuhamo v 3 dl vode. Po 20 minutah (oziroma ko se buča popolnoma zmehča) jo odstavimo, dodamo 70 g masla, sol in poper po okusu ter zmiksamo s paličnim mešalnikom v gladko kremo. '),
(31, 7, 3, 'V manjši ponvi segrejemo preostanek masla in v njem prepražimo bučne kocke ter žajbljeve liste. Solimo in popramo po okusu. '),
(32, 7, 4, 'Za serviranje pripravimo globok krožnik. Na sredino krožnika postavimo dve žlici kremnega sira, dve rezini bresaole (ali govejega pršuta) in potresemo žlico bučnih semen. Dodamo tudi bučne kocke in žajbljeve liste. Preko vsega sveže naribamo limonino lupino ter prelijemo z žlico olivnega olja z limono. Na koncu prilijemo še bučno kremo.'),
(33, 8, 1, 'Polovički piščančjih prsi vodoravno prerežemo na pol, da dobimo štiri kose, ki jih na obeh straneh začinimo s soljo, poprom in česnom v prahu, nato pa jih povaljamo v moki. '),
(34, 8, 2, 'Mlado špinačo operemo in dobro osušimo. Paradižnike narežemo na koščke. '),
(35, 8, 3, 'Na štedilnik pristavimo večjo ponev ter v njej segrejemo mešanico olja in masla. Na vroči maščobi na obeh straneh zlato rjavo popečemo kose piščančjega mesa (približno 4 minute na vsaki strani). Pečeno meso odstranimo iz ponve in ga shranimo na toplem krožniku. '),
(36, 8, 4, 'V ponev, v kateri smo pekli meso, vlijemo jušno osnovo in vino, če smo se odločili, da ga bomo uporabili. Dodamo gorčico in s kuhalnico dobro postrgamo po dnu ponve, da odlepimo vse karamelizirane koščke, ki so nastali med pečenjem mesa. Pustimo, da omaka na srednji temperaturi vre 1-2 minuti. '),
(37, 8, 5, 'V ponev prilijemo smetano in dodamo špinačo ter sušene paradižnike. Počakamo, da špinača uvene , nato pa v omako vrnemo pečene kose piščančjega mesa. Pustimo, da se vse skupaj kuha še kakšnih 5 minut oziroma toliko časa, da je piščanec kuhan tudi v notranjosti. Če se nam zdi potrebno, lahko prilijemo še malo vode ali jušne osnove, omako pa po potrebi dodatno začinimo.'),
(38, 8, 6, 'Pripravljeno jed takoj postrežemo. Za prilogo lahko ponudimo riž, polento, pire krompir, testenine ali njoke. '),
(39, 9, 1, 'Pripravo pečenega piščanca začnemo dan pred peko. Piščanca najprej nasolimo in ga pustimo stati 30 minut. '),
(40, 9, 2, '\r\nZmešamo pinjenec in 4 žlice fine soli. Piščanca damo v večjo vrečko za živila (5 kg) in vanjo zlijemo pinjenec s soljo. Vrečko zvežemo, nato pa piščanca z vseh strani oblijemo z marinado. Postavimo v hladilnik za najmanj 12 ur (najbolje kar čez noč). '),
(41, 9, 3, 'Piščanca vzamemo iz hladilnika eno uro pred peko. Pečico segrejemo na 220 stopinj Celzija.'),
(42, 9, 4, 'Piščanca odstranimo iz vrečke, z rokami nežno odstranimo pinjenec, nato ga položimo v pekač in potisnemo v pečico, tako da noge obrnemo proti zadnjemu levemu kotu pečice.'),
(43, 9, 5, 'Po 20 minutah peke znižamo temperaturo na 200 stopinj Celzija in pečemo še 10 minut, nato pekač obrnemo, tako da noge gledajo proti zadnjemu desnemu kotu pečice. Tako se bo lepo obarval še z druge strani. Piščanca pečemo še približno 30 minut.'),
(44, 10, 1, 'Šalotko in česen olupimo ter ju ločeno drobno sesekljamo. Lignje osušimo s papirnatimi brisačkami in jih zrežemo na približno centimeter široke kolute.'),
(45, 10, 2, 'Ponev dobro segrejemo, nato pa vanjo vlijemo olje. Dodamo inčune in jih na hitro popražimo, da se razpustijo. Dodamo šalotko in jo pražimo, da postekleni. '),
(46, 10, 3, 'Dodamo narezane lignje in pražimo dalje. Lignji bodo spustili nekaj tekočine, zato lahko temperaturo tudi nekoliko povišamo. Ko se začnejo lignji barvati, v ponvi pa tudi ni več odvečne tekočine, dodamo česen ter prilijemo vino. Kuhamo dalje, da se vino na pol ukuha. '),
(47, 10, 4, 'Prilijemo paradižnik ter omako začinimo s soljo, poprom in rožmarinom. Po želji dodamo tudi nekaj vejic svežega timijana. Ponev pokrijemo in pustimo, da se jed ob rahlem vretju kuha 25 minut. '),
(48, 11, 1, 'Česen olupimo in ga drobno nasekljamo. V večjo ponev damo maslo in ko se razpusti, dodamo česen, ki ga na nizki temperaturi med mešanjem pražimo 2 minuti. '),
(49, 11, 2, 'Prilijemo kokošjo osnovo, mleko in smetano za kuhanje. Solimo in popramo po okusu ter premešamo.'),
(50, 11, 3, 'Dodamo testenine, počakamo, da se malce zmehčajo, nato pa jih kuhamo toliko časa, kot je navedeno na embalaži. Med kuhanjem jih nekajkrat premešamo.'),
(51, 11, 4, 'Tik pred koncem kuhanja vmešamo nariban parmezan in testenine še zadnjič premešamo.');

